var doc = new jsPDF();
var button = document.getElementById("generatePDF");
button.addEventListener('click', printPDF);

function printPDF() {
    var imgData = 'data:image/png;base64,';

    doc.setFontSize(15);
    doc.addImage(imgData, 'PNG', 0, 0, 210, 290);

    doc.text(70, 120, document.getElementById("footprint").value);
    doc.text(50, 133, document.getElementById("transp").value);
    doc.text(65, 145, document.getElementById("carbon").value);

    doc.text(178, 176, document.getElementById("tree").value);
    doc.text(185, 185, document.getElementById("absorb").value);

    doc.save('Carbon Visual Quest.pdf');
}
